import Web from "../src/image/launcher.svg";
import Common from "./Common";

const Home = () => {
    return (
        <>
            <Common imgsrc={Web} btntext="Get Started" link="/service" text={<h1>Build Your Website With <strong>Technical Abhishek</strong></h1>}/>
        </>
    )
}

export default Home;







